import React from 'react';
import store from '../redux/store';
import { useParams } from 'react-router-dom';

const Predmet = (props) => {
  const predmeti = store.getState().predmeti.items;
  const { idPredmet } = useParams();
  console.log(idPredmet);

  return (
    <div>
      <p>
        {props.idPredmet} {props.naziv}
      </p>
      {idPredmet &&
        predmeti
          .filter((pred) => pred.idPredmet === +idPredmet)
          .map((pred) => {
            return (
              <div key={pred.idPredmet}>
                <p>
                  {pred.idPredmet} {pred.naziv}
                </p>
              </div>
            );
          })}
    </div>
  );
};

export default Predmet;
